import React from 'react';
import logo from './logo.svg';
import './App.css';
import SearchResults from './components/searchResults';
import { Provider } from 'mobx-react';
import SearchStore from './mobx/store';

function App() {
  return (
    <div className="App">
      <Provider searchStore={SearchStore}>
        <SearchResults />
      </Provider>
    </div>
  );
}

export default App;
